window.bookSummaryJSON = "<p><b>We failed. The one person we relied on since childhood betrayed us. And here we are, running for our lives and facing an impossible decision.</b></p> <p>Do we stay and fight for our brother, or do we let him go?</p> <p>We traveled to a different world to find him, we went through irreversible changes for a chance to rescue him. I refuse to accept that there wasn't a reason for his betrayal.</p> <p>We can't stop now.</p> <p>Family means everything, and priorities change now that we have Alyssa in our lives.</p> <p>A mate. That one perfect person to cherishâ€¦ to share. And if there was one thing we were good at, it was sharing.</p> <p>But the fight isn't over. We were never a bunch that accepted defeat easily. And even with all of the questions and changes lingering on the horizon, there could be no holding back. Because Damon isn't the only reason why we're here. We have a destiny and no other choice but to seize it.</p> <p>It was time to step up, time to fight for our family, time to show this world the Kings we could be.</p>"; 
